import base64
from tkinter import *
import tkinter.font as font
from tkinter.messagebox import *
import random
from io import BytesIO
from PIL import Image, ImageTk

Moves = ['rock', 'paper', 'scissors']
gameRules = {'paper vs rock': '10', 'rock vs scissors': '10', 'paper vs scissors': '01',
             'rock vs paper': '01', 'scissors vs rock': '01', 'scissors vs paper': '10'}
windowColor = '#cbd2d0'
resultColor = '#124562'


# ================================== create image ====================================
rock_str = b''
byte_data = base64.b64decode(rock_str)
image_data = BytesIO(byte_data)
rock_image = Image.open(image_data)
paper_str = b' '
byte_data = base64.b64decode(paper_str)
image_data = BytesIO(byte_data)
paper_image = Image.open(image_data)
scissors_str = b''
byte_data = base64.b64decode(scissors_str)
image_data = BytesIO(byte_data)
scissors_image = Image.open(image_data)


# im = ImageTk.PhotoImage(image)


def getName():
    # ================================== setting ====================================
    global playerScore
    global computerScore
    playerScore = 0
    computerScore = 0
    global userName
    getName_window = Tk()
    getName_window.title("Username")
    getName_window.geometry('250x150')
    getName_window.resizable(width=False, height=False)

    # ================================== label ====================================
    myFont_label = font.Font(family='Helvetica', size=13)
    getName_label = Label(getName_window, text="Please enter your name:", font=myFont_label).place(x=33, y=15)

    # ================================== entry ====================================
    entryName = StringVar()
    myFont_entry = font.Font(family='Helvetica', size=13)
    getName_entry = Entry(getName_window, font=myFont_entry, textvariable=entryName).place(x=52, y=55, height=28,
                                                                                           width=140)

    # ================================== button ====================================
    myFont_button = font.Font(family='Helvetica', size=13)
    getName_button = Button(getName_window, text='Next', bg='#5D7056', fg='#ffffff', font=myFont_button,
                            command=lambda: getName_window.destroy()).place(x=100, y=100)

    # ================================== result ====================================
    getName_window.mainloop()
    userName = entryName.get()
    getRound()


def getRound():
    def getRound_destroy(round):
        global gameRound
        gameRound = round
        getRound_window.destroy()

    # ================================== setting ====================================
    getRound_window = Tk()
    getRound_window.title("The Game Round")
    getRound_window.geometry('300x180')
    getRound_window.resizable(width=False, height=False)

    # ================================== label ====================================
    myFont_label = font.Font(family='Helvetica', size=13)
    getGameRound_label = Label(getRound_window, text="Please select the game round:", font=myFont_label).place(x=33,
                                                                                                               y=30)

    # ================================== button ====================================
    myFont_button = font.Font(family='Helvetica', size=12)
    getName_button = Button(getRound_window, text='best of 3', bg='#5AA4C2', fg='#ffffff', font=myFont_button,
                            command=lambda: getRound_destroy(3)).place(x=20, y=100)
    getName_button = Button(getRound_window, text='best of 5', bg='#7EC25A', fg='#ffffff', font=myFont_button,
                            command=lambda: getRound_destroy(5)).place(x=110, y=100)
    getName_button = Button(getRound_window, text='best of 7', bg='#C25A5A', fg='#ffffff', font=myFont_button,
                            command=lambda: getRound_destroy(7)).place(x=200, y=100)
    # ================================== result ====================================
    getRound_window.mainloop()
    gameWindow()


def gameWindow():
    # ================================== setting ====================================
    window = Tk()
    window.title("Rock-Paper-Scissors Game")
    window.geometry('600x450')
    window.resizable(width=False, height=False)
    window['background'] = windowColor

    def showScore(playerMove):
        global playerScore
        global computerScore

        rock_bt['state'] = DISABLED
        paper_bt['state'] = DISABLED
        scissors_bt['state'] = DISABLED
        # window.update()
        # ================================== player_move_show ====================================
        playerMoveIm = globals()[f'{playerMove}_image']
        playerMove_image = ImageTk.PhotoImage(playerMoveIm.resize((133, 133)))

        playerMove_label = Label(result, image=playerMove_image, bg=resultColor)
        playerMove_label.photo = playerMove_image
        playerMove_label.place(relx=0.23, rely=0.45, anchor=CENTER)

        myFont_label = font.Font(size=12)
        playerMove_label2 = Label(window, font=myFont_label, text='Player Move', bg=resultColor)
        playerMove_label2.place(relx=0.23, rely=0.65, anchor=CENTER)

        # ================================== computer_move_show ====================================
        computerMove = random.choice(Moves)

        computerMoveIm = globals()[f'{computerMove}_image']
        computerMove_image = ImageTk.PhotoImage(computerMoveIm.resize((133, 133)))

        computerMove_label = Label(result, image=computerMove_image, bg=resultColor)
        computerMove_label.photo = computerMove_image
        computerMove_label.place(relx=0.77, rely=0.45, anchor=CENTER)

        myFont_label = font.Font(size=12)
        computerMove_label2 = Label(window, font=myFont_label, text='Computer Move', bg=resultColor)
        computerMove_label2.place(relx=0.77, rely=0.65, anchor=CENTER)

        # ================================== disappear_result ====================================
        def disappearResult():
            computerMove_label.destroy()
            computerMove_label2.destroy()
            playerMove_label.destroy()
            playerMove_label2.destroy()
            if playerScore > round(gameRound) / 2:
                myFont_label = font.Font(size=12)
                playerScore_label = Label(window, font=myFont_label, text='Player Win....!', bg=resultColor)
                playerScore_label.place(relx=0.5, rely=0.45, anchor=CENTER)

            elif computerScore > round(gameRound) / 2:
                myFont_label = font.Font(size=12)
                computerScore_label = Label(window, font=myFont_label, text='Computer Win....!', bg=resultColor)
                computerScore_label.place(relx=0.5, rely=0.45, anchor=CENTER)
            else:
                rock_bt['state'] = NORMAL
                paper_bt['state'] = NORMAL
                scissors_bt['state'] = NORMAL

        # ================================== round_result ====================================
        if playerMove != computerMove:
            ch = f"{playerMove} vs {computerMove}"
            score = gameRules.get(ch)
            playerScore += int(score[0])
            computerScore += int(score[1])
            best_of_label['text'] = f"{userName.capitalize()}  {playerScore} : {computerScore}  Computer"

        window.after(1500, disappearResult)

    def newGame(window):
        if askyesno(title='New Game', message="Do you want to reset the game?"):
            window.destroy()
            getName()

    # ================================== button ====================================
    new_game_bt = Button(window, text="New Game", width=10, height=3, command=lambda: newGame(window))
    new_game_bt.place(x=500, y=10)

    rock_im = ImageTk.PhotoImage(rock_image.resize((66, 66)))

    rock_bt = Button(window, image=rock_im, command=lambda: showScore('rock'))
    rock_bt.place(x=100, y=360)
    rock_bt['background'] = windowColor

    paper_im = ImageTk.PhotoImage(paper_image.resize((66, 66)))

    paper_bt = Button(window, image=paper_im, command=lambda: showScore('paper'))
    paper_bt.place(x=260, y=360)
    paper_bt['background'] = windowColor

    scissors_im = ImageTk.PhotoImage(scissors_image.resize((66, 66)))

    scissors_bt = Button(window, image=scissors_im, command=lambda: showScore('scissors'))
    scissors_bt.place(x=420, y=360)
    scissors_bt['background'] = windowColor

    # ================================== label ====================================
    myFont_label = font.Font(size=12)
    best_of_label = Label(window, font=myFont_label, text=f"Best of:  {gameRound}")
    best_of_label.place(x=20, y=20)
    best_of_label['background'] = windowColor

    # ================================== frame ====================================
    result = Frame(window, width=500, height=250, bg=resultColor).place(relx=0.5, rely=0.45, anchor=CENTER)

    myFont_label = font.Font(size=12)
    best_of_label = Label(window, text=f"{userName.capitalize()}  {playerScore} : {computerScore}  Computer",
                          bg=resultColor, font=myFont_label)
    best_of_label.place(relx=0.5, rely=0.23, anchor=CENTER)

    window.mainloop()


getName()
